window.bookSummaryJSON = "<p>Looming war threatens all Feyre holds dear in the third volume of the number-one <i>New York Times</i> best-selling A Court of Thorns and Roses series. </p> <p>Feyre has returned to the Spring Court determined to gather information on Tamlin's maneuverings and the invading king threatening to bring Prythian to its knees. But to do so, she must play a deadly game of deceit - and one slip may spell doom not only for Feyre but for her world as well. </p> <p>As war bears down upon them all, Feyre must decide who to trust among the dazzling and lethal High Lords - and hunt for allies in unexpected places. </p> <p>In this thrilling third book in the number-one <i>New York Times</i> best-selling series from Sarah J. Maas, the earth will be painted red as mighty armies grapple for power over the one thing that could destroy them all. </p>"; 
